def train_xgboost():
    df = pd.read_csv("../input/stage1_labels.csv")

    x = get_trn()
    y = df['cancer'].as_matrix()

    skf = StratifiedKFold(n_splits=5, random_state=2017, shuffle=True)

    clfs = []
    for train_index, test_index in skf.split(x, y):
        trn_x, val_x = x[train_index,:], x[test_index,:]
        trn_y, val_y = y[train_index], y[test_index]

        clf = xgb.XGBRegressor(max_depth=6,
                               n_estimators=1500,
                               min_child_weight=100,
                               learning_rate=0.037,
                               nthread=8,
                               subsample=0.9,
                               colsample_bytree=0.95,
                               seed=42)

        clf.fit(trn_x, trn_y, eval_set=[(val_x, val_y)], verbose=True, eval_metric='logloss', early_stopping_rounds=50)
        clfs.append(clf)

    return clfs


def make_submite():
    clfs = train_xgboost()

    df = pd.read_csv("../input/stage1_sample_submission.csv")

    x = get_tst()
    preds = []
    for clf in clfs:
        preds.append(np.clip(clf.predict(x),0.001,1))

    pred = gmean(np.array(preds), axis=0)
    df['cancer'] = pred
    df.to_csv('subm1.csv', index=False)
    print(df.head())


if __name__ == '__main__':
    make_submite()
